import React from 'react';
import Tilt from 'react-tilt';
import brain from './brain.png';
import './Logo.css';

const Logo = () => {
    return (
        <div className='ma4 mt0'>
            <Tilt className="Tilt br 2 shadow-2 pointer" options={{ max : 55 }} style={{ height: 150, width: 250 }} >
                <div className="Tilt-inner pa3"> <img style={{paddingTop: '5px'}} alt='brain-log' src={brain}></img> </div>
            </Tilt>

        </div>
    );
}


export default Logo;
